import Dexie from 'dexie';
import { User } from './model/user';
import { Team } from './model/team';

export class AppDb extends Dexie {
  users: Dexie.Table<User, number>;
  teams: Dexie.Table<Team, number>;

  constructor() {
    super('AppDb');
    this.version(1).stores({
      users: 'id++, firstName, lastName, username, email, password, usedDevices',
      teams: 'id++, name, description, members, projectList',
    });

    this.users = this.table('users');
    this.teams = this.table('teams');
  }
}

export const appDbInstance = new AppDb();
